import React, { Component } from 'react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

export default class AssignmentFrom extends Component {
    constructor(){
        super()
        this.state={
            startDate: new Date(),
            title: "",
            assign: ""

        }
    }

    handleChange = () =>{
        this.setState
    }
    render() {
        return (
            <div>
                <form class="ui form">
                    <div class="field">
                        <label>Title</label>
                        <input type="text" name="first-name" placeholder="First Name" name= "title" onChange={this.handleChange}/>
                    </div>
                    <div class="field">
                        <label>Due Date:</label>
                        <DatePicker 
                        selected={this.state.startDate}
                        onChange={this.handleChange}
                        name = "startDate"
                        minDate={new Date()}    
                    />
                </div>



                    <div class="field">
                        <label>Assignemt</label>
                        <textarea type="text" name="last-name" placeholder="Last Name"
                        onChange= {this.handleChange}
                        name = "assign"
                        ></textarea>
                    </div>
                    <div class="field">

                    </div>
                    <button class="ui button" type="submit">Submit</button>
                    </form>

            </div>
        )
    }
}
